DROP TABLE IF EXISTS roles;
CREATE TABLE roles (
  idRol int NOT NULL AUTO_INCREMENT,
  codigo varchar(20) NOT NULL,
  nombre varchar(100) NOT NULL,
  indicadorHabilitado tinyint(1) NOT NULL,
  PRIMARY KEY (idRol),
  UNIQUE KEY codigo_rol_UNIQUE (codigo)
);
