DROP TABLE IF EXISTS usuarios;
CREATE TABLE usuarios (
  idUsuario int NOT NULL AUTO_INCREMENT,
  usuario varchar(50) NOT NULL,
  contrasenia varchar(150) NOT NULL,
  idPersona int NOT NULL DEFAULT '0',
  indicadorHabilitado tinyint(1) NOT NULL,
  idRol int NOT NULL DEFAULT '2',
  verificado int DEFAULT NULL,
  tokenValidacionCorreo varchar(36) DEFAULT NULL,
  fechaExpiracionToken datetime DEFAULT NULL,
  PRIMARY KEY (idUsuario),
  UNIQUE KEY usuario_UNIQUE (usuario),
  KEY fk_usuarios_persona1_idx (idPersona),
  KEY fk_usuarios_roles1_idx (idRol),
  CONSTRAINT fk_usuarios_persona1 FOREIGN KEY (idPersona) REFERENCES persona (idPersona),
  CONSTRAINT fk_usuarios_roles1 FOREIGN KEY (idRol) REFERENCES roles (idRol)
);
